COPY batches (id, name, submitter_name, submitter_email, submitter_affiliation, reason_for_inclusion, file, url_slug, created_at, updated_at, reference_sequence_version, tags, reference_url) FROM stdin;
1	My Cancer Genome	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	My Cancer Genome outlines variants that drive tumorigenesis and/or that have therapeutic implications. Upon review of the publications that My Cancer Genome cites, the majority of variants appear to be pathogenic. Few variants are diagnostic or prognostic. My Cancer Genome also identifies relevant clinical trials for variants. The variants outlined in My Cancer Genome are well supported with a detailed write up outlining each variant’s role in a particular cancer type. Links to these pages were included in DoCM to allow for access to these summaries for additional information about these variants. A representative transcript was chosen such that the amino acid change would resemble the variant outlined in the paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen. Variants without literature support were not included in DoCM.	mcg.tsv	3566d868-ab6e-436d-88e5-3a5300e710e8-my-cancer-genome-ben	2016-05-18 19:52:57.980403	2016-05-18 19:52:57.980403	\N	Pathogenic	https://www.mycancergenome.org/about/what-is-my-cancer-genome/
2	WashU hematologic malignancy mutation list	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	The WashU hematologic malignancy mutation list represents variants outlined for their importance in leukemias by investigators at Washington University that study hematologic malignancies. Many of these variants have established effects on tumor growth in leukemias with some having clinical trials performed. The variants were provided by domain experts in the genomics of hematologic malignancies and further curated against the biomedical literature. The transcript was chosen such that the amino acid change resembles the variant outlined in the cited paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen.	tl.tsv	fb4d49d4-6925-4c22-8e66-8119056d3014-washu-hematologic-malignancy	2016-05-18 20:26:10.46571	2016-05-18 20:26:10.46571	\N	Likely Pathogenic	
3	Literature	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	This is a list of variants curated from the literature in the original release of DoCM.	literature.tsv	ac995c00-fb09-4cda-a2c5-ee64b7c61663-literature-ben-ainscough	2016-05-18 20:32:54.138008	2016-05-18 20:32:54.138008	\N		
4	Drug Gene Knowledge Database	Jason Kunisaki, Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	The Drug Gene Knowledge Database by Dienstmann et al. [Cancer Discov; 5(2); 118-23] is an open resource that outlines the “prevalence of mutations and copy-number alterations with predictive associations across solid tumors.” This resource outlines the importance of individual variants in cancer along with a PubMed reference including the drugs that target a particular mutation. Only variants with a PubMed reference were included in DoCM. Since this database is open, high quality and freely available, useful metadata, like drug sensitivity information, was included in DoCM. The transcript was chosen such that the amino acid change resembles the variant outlined in the paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen.	dienstmann.tsv	7b2c6957-0308-49aa-9b6b-57831e3436e4-drug-gene-knowledge-database	2016-05-18 20:50:21.655622	2016-05-18 20:50:21.655622	\N	Likely Pathogenic	http://cancerdiscovery.aacrjournals.org/content/5/2/118.full.pdf 
5	Oncomap variants	Mayank Choudhary, Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	Oncomap is a listing of 471 variants with known and established importance in cancer, many of which are known to predict response or resistance to targeted therapies. The panel is used as a diagnostic test to identify tumorigenic mutations in clinical cases by MacConnaill et al. in their manuscript in the Journal of Molecular Diagnostics. Many of these mutations overlap with mutations already existing in DoCM and this panel adds further credibility to their importance. As only the gene and amino acid were listed in the publication, many fields were filled in by manual curation. The transcript was chosen such that the amino acid change resembles the variant outlined in the cited paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen. Associated diseases and other relevant sources were identified by searching PubMed for the gene and amino acid change.	oncomap.tsv	4816605b-9ef2-466e-9402-2cfed05c84fd-oncomap-variants-mayank	2016-05-18 21:06:38.924503	2016-05-18 21:06:38.924503	\N	Likely Pathogenic	http://journals.plos.org/plosone/article?id=10.1371/journal.pone.0007887
